from urllib2 import *
import os, base64, hashlib, sys, textwrap, repair, platform


class Firstrun():
    
    keyboardHelp = ''

    block32 = ''

    stop32 = ''

    minus32 = ''

    plus32 = ''

    icon = ''
    repair.index = ''

    def mkCSDV(self, title, content):
        if not os.path.exists(self.dataDir+'/data/'+title+'.csdv'):
            print('Creating blank CSDV File for '+title+' items...')
            file = open(self.dataDir+'/data/'+title+'.csdv', 'a')
            file.write(content)
            file.close()
            return 1
        else:
            return 0

    def readBlob(self, file, blob):
        blob = base64.b64decode(blob)
        open(file,"wb").write(blob)
        return True

    def genFile(self, title, ext, location = '/data/resources/', dataDir = '.'):
        if not os.path.exists(dataDir+location+title+'.'+ext):
            self.readBlob(dataDir+location+title+'.'+ext, getattr(self, title))
            print('Reconstituting '+title+'... ')

    def __init__(self, dataDir):
        self.dataDir = dataDir
        if not os.path.exists(dataDir+'./data/firstrun'):
            print('Application is being setup!')
            self.setup(dataDir)
        else:
            print('Application has already been setup!')

    def setup(self, dataDir):
        print('Generating blank CSDV Resources...')
        if not os.path.exists(self.dataDir):
            os.mkdir(self.dataDir)
        
        if not os.path.exists(self.dataDir+'/data'):
            os.mkdir(self.dataDir+'/data')
        
        self.mkCSDV('bills', 'Discription\tAmount\tFrequency\tLast Payed')
        self.mkCSDV('budget', 'Discription\tAllowance\tAmount to Date')
        self.mkCSDV('registry', 'Date\tTransaction\tAccount\tDebit\tCredit\tBalance')
        self.mkCSDV('items', 'Item Name\tItem Discription\tCateogry\tPrice\tLocation')
        self.mkCSDV('recipies', 'Title\tDiscription\tCateogry\tItems')
        print('')
        
        print('Reconstituting resource files...')
        if not os.path.exists(dataDir+'/data/resources'):
            os.mkdir(dataDir+'/data/resources')
        #self.genFile('stop32', 'png')
        #self.genFile('minus32', 'png')
        #self.genFile('plus32', 'png')
        self.genFile('icon', 'icns')
        self.genFile('repair.index', 'html')
        print('')
        
        print('First Run of Application Detected')
        if not os.path.exists('./data/backup'):
            os.mkdir('./data/backup')
        if not os.path.exists('./data/backup/data'):
            os.mkdir('./data/backup/data')
        if not os.path.exists('./data/backup/data/resources'):
            os.mkdir('./data/backup/data/resources')
        #backup = repair.repair('backup')
        open(self.dataDir+'/data/firstrun', 'w').write('')


